import React from "react";

function ColorItemInput(props) {
  return (
    <>
      <input
        id={props.colorItemColor}
        type="radio"
        name="color"
        checked={props.color === props.colorItemColor}
        onChange={() => props.setAttribute("color", props.colorItemColor)}
      />
      <label
        htmlFor={props.colorItemColor}
        style={{
          backgroundColor: props.colorItemColor,
        }}
      ></label>
    </>
  );
}

function CreateAreaColor(props) {
  return (
    <div className="create-color">
      {[
        "#f8c51b",
        "#f96262",
        "#23d5e7",
        "#dda6F7",
        "#2198d3",
        "#6ecfbb",
        "#bee14f",
        "#26ad60",
      ].map((x) => (
        <ColorItemInput
          colorItemColor={x}
          color={props.color}
          setAttribute={props.setAttribute}
        />
      ))}
      {/* Yellow */}
      <ColorItemInput
        colorItemColor="#f8c51b"
        color={props.color}
        setAttribute={props.setAttribute}
      />

      {/* Red */}
      <ColorItemInput
        colorItemColor="#f96262"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      {/* LightBlue */}
      <ColorItemInput
        colorItemColor="#23d5e7"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      {/* Purple */}
      <ColorItemInput
        colorItemColor="#dda6F7"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      {/* DarkBlue */}
      <ColorItemInput
        colorItemColor="#2198d3"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      {/* Aqua */}
      <ColorItemInput
        colorItemColor="#6ecfbb"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      {/* LightGreen */}
      <ColorItemInput
        colorItemColor="#bee14f"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      {/* DarkGreen */}
      <ColorItemInput
        colorItemColor="#26ad60"
        color={props.color}
        setAttribute={props.setAttribute}
      />
    </div>
  );
}

export default CreateAreaColor;
